import { useRef, useState, Suspense } from 'react'
import { Canvas, useFrame } from '@react-three/fiber'
import './App.css'
import { useGLTF } from '@react-three/drei'
import { OrbitControls, Html, draco } from '@react-three/drei'
import Nav from './Navigation/Nav'

function Shoe({ ...props }) {
  const group = useRef()
  const { nodes, materials } = useGLTF('shoe.glb')
  return (
    <group ref={group} {...props} dispose={null}>
      <mesh
        geometry={nodes['Nike_Air_Max_-_Fixed'].geometry}
        material={materials['default']}
        rotation={[-5.06, -0.35, 0.99]}
        scale={0.16}
      />
    </group>
  )
}

function Lights() {
  return (
    <>
      <ambientLight intensity={0.4} />
      <directionalLight
        castShadow
        position={[-8, 16, -8]}
        intensity={0}
        shadow-mapSize-width={1024}
        shadow-mapSize-height={1024}
        shadoe-camera-far={50}
        shadoe-camera-left={-10}
        shadoe-camera-right={10}
        shadoe-camera-top={10}
        shadoe-camera-bottom={-10}
      />
      <pointLight position={[0, 50, 0]} intensity={2} />
    </>
  )
}

export default function App() {
  return (
    <div className="home">
      <div className="home-banner-info">NIKE AIR MAX 90</div>
      <div className="home-container">
        <div className="nav">
          <Nav />
        </div>
        <div className="home-title">in the air</div>
        <div className="three">
          <Canvas colorManagement shadowMap camera={{ position: [-5, 4, 4], fov: 40 }}>
            <ambientLight intensity={0.5} />
            <OrbitControls enableZoom={false} rotateSpeed={0.5} enablePan={false} />
            <Suspense fallback={null}>
              <directionalLight intensity={1} position={[100, 0, 0]} />
              <directionalLight intensity={1} position={[0, 100, 0]} />
              <Shoe />
            </Suspense>
          </Canvas>
        </div>
      </div>
      <div class="threesixty">
        <svg xmlns="http://www.w3.org/2000/svg" width="60" height="60" fill="currentColor" class="bi bi-arrow-repeat" viewBox="0 0 16 16">
          <path d="M11.534 7h3.932a.25.25 0 0 1 .192.41l-1.966 2.36a.25.25 0 0 1-.384 0l-1.966-2.36a.25.25 0 0 1 .192-.41zm-11 2h3.932a.25.25 0 0 0 .192-.41L2.692 6.23a.25.25 0 0 0-.384 0L.342 8.59A.25.25 0 0 0 .534 9z" />
          <path
            fill-rule="evenodd"
            d="M8 3c-1.552 0-2.94.707-3.857 1.818a.5.5 0 1 1-.771-.636A6.002 6.002 0 0 1 13.917 7H12.9A5.002 5.002 0 0 0 8 3zM3.1 9a5.002 5.002 0 0 0 8.757 2.182.5.5 0 1 1 .771.636A6.002 6.002 0 0 1 2.083 9H3.1z"
          />
        </svg>
      </div>
    </div>
  )
}
